import React from 'react'
import Highcharts from 'highcharts'
import HighchartsReact from 'highcharts-react-official'

const options = {
    title: {
        text: 'My chart'
    },
    series: [{
        name: 'Profits',
        data: [1, 2, 3]
    }]
}

export default ({data}) =>
    <HighchartsReact
        highcharts={Highcharts}
        options={options}
    />
